import React, {useState} from 'react'
import Modal from './Modal'


const Navbar = () => {

   const [estadoModal, cambiarEstadoModal] = useState(false);

return(
<>
  <Modal>

  estado= {estadoModal}
  cambiarEstado={cambiarEstadoModal}

  </Modal>

<nav className="navbar navbar-dark bg-dark "> 
<div className="container ">

<a className="navbar-brand" href="/"><h3>Muro interactivo -BTS-</h3></a>
  <div className="d-grid gap-2 d-md-flex justify-content-md-end">
<button className="btn btn-outline-light me-md-2" type="button" >Iniciar secion</button>
<button className="btn btn-outline-light" type="button"><i className="material-icons">add</i>

</button>
</div>
 </div>
</nav>
</>

)
}

export default Navbar;
